import React, { Fragment } from "react";
import { Card } from "antd";

const InformationList = ({ data }) => {
  return (
    <Fragment>
      {data.map(info => (
        <Card title={<p>{`Table:${info.table}`}</p>}></Card>
      ))}
    </Fragment>
  );
};

export default InformationList;
